function Resume() {
  return (
    <div className="Resume">
      <div className="resume-contents">
        <h2>Resume</h2>
        <h3>Education</h3>
        <h5>University of California, San Diego</h5>
        <h6>University of California, San Diego</h6>

      </div>
    </div>
  )
}

export default Resume
